[{"location":"","page":"Home","title":"Home","text":"CurrentModule = FebusTools","category":"page"},{"location":"#FebusTools","page":"Home","title":"FebusTools","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for FebusTools.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [FebusTools]","category":"page"},{"location":"#FebusTools.read_hdf5","page":"Home","title":"FebusTools.read_hdf5","text":"read_hdf5(file[, cut1[, cut2]]; zones, sources) -> ::FebusData\n\nRead strain or strain rate data from file on disk, reading blocks between dates cut1 and cut2.  By default, all data are read.\n\nTo limit data to a set of zones, supply a function of form f(::Int)::Bool to zones which returns true when its first argument is the number of the zone to accept.\n\nLikewise, supply a function of the form f(::Int)::Bool for sources to accept source a set of source numbers.\n\nnote: Note\nCurrently only the first source of the first zone is read, and an error is thrown if more than one zone or source is present in a file.\n\n\n\n\n\n","category":"function"}]
